import {Component} from "react";
import {JourneyHeader} from "./JourneyHeader";

export class Journey extends Component
{
	constructor(props)
	{
		super(props);
		this.state = {
			header: null,
			childNodes: []
		};
	}

	componentDidMount()
	{
		// TODO: Dummy data
		this.setState((prevState) => ({
			childNodes: [...prevState.childNodes, {word: "kers"}, {word: "krsos"}, {word: "hrussa"}, {word: "hross"}, {word: "horse"}]
		}));
	}

	render()
	{
		let childNodeElements = [];
		console.log(this.state.childNodes);
		this.state.childNodes.forEach((childNode) => {
			childNodeElements.push(<JourneyNode word={childNode.word} />);
		});

		return(
			<div>
				<JourneyHeader word={"horse"} />

			</div>
		)
	}
}
